webpackJsonp([0x7b44be102b1a],{575:function(e,a){e.exports={pathContext:{docHtml:'<h1>Changelog</h1>\n<h2>v0.5</h2>\n<p><a href="https://github.com/argoproj/argo-events/pull/92">#92</a></p>\n<ul>\n<li>Introduced gateways as event generators. </li>\n<li>Added multiple flavors of gateway - core gateways, gRPC gateways, HTTP gateways, custom gateways</li>\n<li>Added K8 events to capture gateway configurations update and as means to update gateway resource</li>\n<li>SLA violations are now reported through k8 events</li>\n<li>Sensors can trigger Argo workflow, any kubernetes resource and gateway</li>\n<li>Gateway can send events to other gateways and sensors</li>\n<li>Added examples for gateway and sensors</li>\n<li>Sensors are now repeatable and fixed all issues with signal repeatability.</li>\n<li>Removed signal deployments as microservices.</li>\n</ul>\n<h2>v0.5-beta1 (tbd)</h2>\n<ul>\n<li>Signals as separate deployments <a href="https://github.com/argoproj/argo-events/pull/49">#49</a></li>\n<li>Fixed code-gen bug <a href="https://github.com/argoproj/argo-events/issues/46">#46</a></li>\n<li>Filters for signals <a href="https://github.com/argoproj/argo-events/issues/26">#26</a></li>\n<li>Inline, file and url sources for trigger workflows <a href="https://github.com/argoproj/argo-events/issues/41">#41</a></li>\n</ul>\n<h2>v0.5-alpha1</h2>\n<ul>\n<li>Initial release</li>\n</ul>',docPath:"argo-events/changelog",proj:"argo-events"}}}});
